style.css:
@-moz-document domain("webclient.moomellow.com") {
body,
div,
iframe {
    background: #000;
    color: #808080;
}
body,
div,
input {
    font-size: 1.0em;
}
a,
a:visited {
    color: #C390D4;
}
a:hover {
    color: #D4A190;
}
input {
    background: #000;
    color: #808080;
    border: 1px solid #808080 !important;
}
input#clientInputField {
    width: 400px;
}
/* Had to kill the color variations
because the blue is unreadable */

font {
    color: #606060;
}
}
